//转换文本
function StranText(txt,toFT,chgTxt)
{
	if(txt==""||txt==null)return ""
	toFT=toFT==null?BodyIsFt:toFT
	if(chgTxt)txt=txt.replace((toFT?"简":"繁"),(toFT?"繁":"简"))
	if(toFT){
		var strm=Traditionalized(txt);
		var strs=cz.split('|');
		for(var j=0;j<strs.length;j++){
			
			strm=strm.replace(strs[j].split(',')[0],strs[j].split(',')[1]);
		}


		return 	strm;
	}
	else {return Simplized(txt)}
}

//转换对象，使用递归，逐层剥到文本
function StranBody(fobj)
{
	if(typeof(fobj)=="object"){var obj=fobj.childNodes}
	else 
	{
		var tmptxt=StranLink_Obj.innerHTML.toString()
		
		
		if(tmptxt.indexOf("简")<0)
		{
			BodyIsFt=1
			StranLink_Obj.innerHTML=StranText(tmptxt,0,1)
			StranLink_Obj.title=StranText(StranLink_Obj.title,0,1)
			
			$("#Jt").css("display","none");
	        $("#Ft").css("display","");
			$(".logo img").attr("src",sitePath+"images/logo_ft.png");
			
			
		}
		else
		{
			
			BodyIsFt=0
			StranLink_Obj.innerHTML=StranText(tmptxt,1,1)
			StranLink_Obj.title=StranText(StranLink_Obj.title,1,1)
			$("#Jt").css("display","");
	        $("#Ft").css("display","none");
			$(".logo img").attr("src",sitePath+"images/logo.jpg");
		}
		setCookie(JF_cn,BodyIsFt,7)
		var obj=document.body.childNodes
	}
	for(var i=0;i<obj.length;i++)
	{
		var OO=obj.item(i)
		if("|BR|HR|TEXTAREA|SCRIPT|OBJECT|EMBED|".indexOf("|"+OO.tagName+"|")!=-1||OO==StranLink_Obj)continue;
		if(OO.title!=""&&OO.title!=null)OO.title=StranText(OO.title);
		if(OO.alt!=""&&OO.alt!=null)OO.alt=StranText(OO.alt);
		if(OO.tagName=="INPUT"&&OO.value!=""&&OO.type!="text"&&OO.type!="hidden")OO.value=StranText(OO.value);
		if(OO.nodeType==3){OO.data=StranText(OO.data)}
		else StranBody(OO)
	}
}
